/**
 * @file bootstrap 模态框
 * @author 
 * @par Copyright (c): foresee
 *
 * **/

var fsSwal = {
    /**
     *  {data JSON对象数据的封装}
     * **/
    data: {
        injectedHTML: "", // 注入的 HTML
        mainBodyNotice: {  // 正文提示信息 -- 如：“错误编码”、“错误原因”
            errCode: "错误编码",
            errText: "错误原因"
        },
        defaultParams: {
            title: '温馨提示', // 标题
            text: '请输入内容!', // 正文
            type: "error", // 样式 error、info、warning、notice、success -- 使用FontAwesome图标  class="fa fa-anchor xxx" 控制颜色大小 .xxx{color: #B40C0F; font-size: 50px;}
            errCode: "04010004", // 错误编码
            noInFooter: "NO:10000320",
            time: "2017-05-24 15:29:00",
            viewModelType: "3", // "1"、"2"
            timer: "", // 设置 显示时间
            area: {
                width: "450px",
                height: "340px"
            }
        }
    },
    /**
     *  {init 初始化}
     * **/
    init: {
        /**
         *  {initEvent初始化事件}
         * **/
        initEvent: function() {
            //fsSwal.fsSwal("nisada" , "asdasdasdasdqw", "1222222222324");
            fsSwal.fsSwal({title: "Are you sure?", text: "You will not be able to recover this imaginary file!", errCode: "1222222222324"});

        },
        /**
         *  {initData 初始化数据}
         * **/
        initData: function() {
            fsSwal.data.defaultParams.time = fsSwal.getNowFormatDate(); // 获取当前时间
        }
    },
    /**
     *  {viewModel 提示框的视图模型}
     * **/
    viewModel: {
        /**
         *  {getModel 获取提示框视图模型的injectedHTML}
         *  @param arguments[0]--viewModelType, [1]--errTitle, [2]--errMessage, [3]--errCode, [4]--type, 
         *          [5]--noInFooter, [6]--time
         * **/
        getModel: function(params) {
            if (params.viewModelType == "1") { // width: 600px height: 350px -- 用col-xs-10 col-md-10控制响应式变化
                // 设置 injectedHTML
                fsSwal.data.injectedHTML = 
                    '<div id="fsViewModal" class="modal fs-modal fade in" tabindex="-1" role="dialog" id="error" aria-hidden="false" >' +
                       
                        '<div class="modal-dialog" role="document">' +
                            '<div class="modal-content fs-modal-content">' +
                                '<div class="modal-header fs-modal-header">' +
                                    '<button type="button" id="closeBtn" class="fs-close-btn"><span >×</span></button>' +
                                    '<h4 class="modal-title fs-modal-title">' + params.title + '</h4>' +
                                '</div>' +
                                '<div class="modal-body fs-modal-body">' +
                                    '<div class="error row">' +
                                        '<div class="col-xs-2 col-md-2"><i class="' + params.type + '"></i></div>' +
                                        '<div class="col-xs-10 col-md-10">' +
                                            '<div class="row">' +
                                                '<div class="col-md-12 error-code-div">' +
                                                    fsSwal.data.mainBodyNotice.errCode + '：' + params.errCode +
                                                '</div>' +
                                                '<div class="col-md-12 error-text-div">' +
                                                    fsSwal.data.mainBodyNotice.errText + '：' + params.text + 
                                                '</div>' +
                                            '</div>' +
                                        '</div>' +
                                    '</div>' +
                                '</div>' +
                                '<div class="modal-footer fs-modal-footer">' +
                                    '<span class="no-in-footer">' + params.noInFooter + "&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;" + params.time + '</span>' +
                                    '<button type="button" id="confirmBtn" class="fs-btn-confirm btn btn-primary">确定</button>' +
                                '</div>' +
                            '</div>' +
                        '</div>' +
                    '</div>'

                return fsSwal.data.injectedHTML;
            }
            if (params.viewModelType == "2") { // 不可以改变高度
                // 设置 injectedHTML
                fsSwal.data.injectedHTML = 
                    '<div id="fsViewModal" class="fs-layer modal fade in" tabindex="-1" role="dialog" id="error" aria-hidden="false" >' +
                        
                        '<div class="modal-dialog" role="document">' +
                            '<div class="modal-content ">' +
                                '<div class="modal-header ">' +
                                    '<button type="button" id="closeBtn" class="fs-close-btn" style="display:none;"><span >×</span></button>' +
                                    '<h4 class="modal-title fs-modal-title">' + params.title + '</h4>' +
                                '</div>' +
                                '<div class="modal-body">' +
                                    '<div class="error row">' +
                                        '<div class="col-xs-2 col-md-2"><i class="' + params.type + '"></i></div>' +
                                        '<div class="col-xs-10 col-md-10">' +
                                            '<div class="row">' +
                                                '<div class="col-md-12 error-code-div">' +
                                                    fsSwal.data.mainBodyNotice.errCode + '：' + params.errCode +
                                                '</div>' +
                                                '<div class="col-md-12 error-text-div">' +
                                                    fsSwal.data.mainBodyNotice.errText + '：' + params.text + 
                                                '</div>' +
                                            '</div>' +
                                        '</div>' +
                                    '</div>' +
                                '</div>' +
                                '<div class="modal-footer">' +
                                    '<span class="no-in-footer">' + params.noInFooter + "&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;" + params.time + '</span>' +
                                    '<button type="button" id="confirmBtn" class="fs-btn-confirm btn btn-primary">确定</button>' +
                                '</div>' +
                            '</div>' +
                        '</div>' +
                    '</div>'

                return fsSwal.data.injectedHTML;
            }
            if (params.viewModelType == "3") { // 设置可调参数 width height
                     // 设置 injectedHTML
                fsSwal.data.injectedHTML = 
                    '<div id="fsViewModal" class="fs-layer3 modal fade in" tabindex="-1" role="dialog" id="error" aria-hidden="false" >' +
                        
                        '<div class="modal-dialog" role="document">' +
                            '<div class="modal-content ">' +
                                '<div class="modal-header ">' +
                                    '<button type="button" id="closeBtn" style="display:none;"><span >×</span></button>' +
                                    '<h4 class="modal-title fs-modal-title">' + params.title + '</h4>' +
                                '</div>' +
                                '<div class="modal-body">' +
                                    '<div class="error row">' +
                                        '<div class="col-xs-2 col-md-2"><i class="' + params.type + '"></i></div>' +
                                        '<div class="col-xs-10 col-md-10">' +
                                            '<div class="row">' +
                                                '<div class="fs-body-content fs-body-top col-md-12 ">' +
                                                    fsSwal.data.mainBodyNotice.errCode + '：' + params.errCode +
                                                '</div>' +
                                                '<div class="fs-body-content col-md-12 ">' +
                                                    fsSwal.data.mainBodyNotice.errText + '：' + params.text + 
                                                '</div>' +
                                            '</div>' +
                                        '</div>' +
                                    '</div>' +
                                '</div>' +
                                '<div class="modal-footer">' +
                                    '<span class="no-in-footer">' + params.noInFooter + "&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;" + params.time + '</span>' +
                                    '<button type="button" id="confirmBtn" class="btn btn-primary">确定</button>' +
                                '</div>' +
                            '</div>' +
                        '</div>' +
                    '</div>'

                    return fsSwal.data.injectedHTML;
                }

        }
    },
    /*
     *  {fsSwal 模态框}
     *  @param string (title, text, type) or object (opts, callback)
     */
    fsSwal: function() {
        $("#fsViewModal").remove();  // 删除 同一id属性 的 div
        fsSwal.data.defaultParams.time = fsSwal.getNowFormatDate(); // 获取当前时间

        var opts = arguments[0]; // 获取传入的第一个参数
        if (opts === undefined) { 
            alert('fsSwal expects at least 1 attribute!');
            return false;
        }
        var params = fsSwal.extend({}, fsSwal.data.defaultParams); // 传入默认的参数 key、value

        // 判断用户传入值的形式： string or object.
        switch (typeof opts) {
            // eg: fsSwal("Hello", "Just testing", "info");
            case 'string':
                params.title = opts || fsSwal.data.defaultParams.title;
                params.text = arguments[1] || fsSwal.data.defaultParams.text;
                params.type = arguments[2] || fsSwal.data.defaultParams.type;
                break;
            // eg: fsSwal({ title:"Hello", text: "Just testing", type: "info" });
            case 'object':
                if (opts.title === undefined) {
                    alert('Missing "title" argument!');
                    return false;
                }
                params.title = opts.title;
                for (var customName in fsSwal.data.defaultParams) { // 设置默认参数
                    params[customName] = fsSwal.argumentOrDefault(opts, customName);
                }
                params.doneFunction = arguments[1] || null;
                break;
            default:
                alert('Unexpected type of argument! Expected "string" or "object", got ' + typeof opts);
                return false;
        }

        // 设置小图标 error、info、warning ; 设置 errCode “错误编码”，errText “错误原因”
        switch(params.type) {
            case 'error':
                params.type = "fa fa-minus-circle fs-error-font";
                fsSwal.data.mainBodyNotice.errCode = "错误编码";
                fsSwal.data.mainBodyNotice.errText = "错误原因";
                break;
            case 'info':
                params.type = "fa fa-info-circle fs-info-font";
                fsSwal.data.mainBodyNotice.errCode = "信息编码";
                fsSwal.data.mainBodyNotice.errText = "提示信息";
                break;
            case 'warning':
                params.type = "fa fa-warning fs-warn-font";
                fsSwal.data.mainBodyNotice.errCode = "信息编码";
                fsSwal.data.mainBodyNotice.errText = "警告信息";
                break;
            case 'notice':
                params.type = "fa fa-bullhorn fs-notice-font";
                fsSwal.data.mainBodyNotice.errCode = "信息编码";
                fsSwal.data.mainBodyNotice.errText = "警告信息";
                break;
            case 'success':
                params.type = "fa fa-check-circle fs-success-font";
                fsSwal.data.mainBodyNotice.errCode = "信息编码";
                fsSwal.data.mainBodyNotice.errText = "通告信息";
                break;
            default:
                params.type = "fa fa-minus-circle fs-error-font"; // 默认未设值 错误样式
                fsSwal.data.mainBodyNotice.errCode = "错误编码";
                fsSwal.data.mainBodyNotice.errText = "错误原因";
                return false;
        }

        // 获取自定义的 view model
        // var testHTML = fsSwal.viewModel.getModel(params.viewModelType, params.title, params.text, +
        //         params.errCode, params.type, params.noInFooter, params.time); 使用arguments去接受参数有问题。默认把str转成了int
        var testHTML = fsSwal.viewModel.getModel(params);
        if (testHTML) { // 注入 dom
            fsSwal.createDom(testHTML);
        }
        // 修改 bootstrap 模态框的大小
        if (opts.area && (params.viewModelType == "3")) { // 使用 opts 传参数 -- 如果用户没有输入进来则不改变
            $('#fsViewModal').on('show.bs.modal', function (event) {
                var modal = $(this);
                // modal.find('.modal-title').text('New message to ' + recipient);
                modal.find('.modal-body').css("height", opts.area.height || param.area.height || fsSwal.data.defaultParams.height);
                modal.find('.modal-content').css("width", opts.area.width || param.area.width || fsSwal.data.defaultParams.width);
                
            });  
        }

        // bootstrap API -- 起始
        $("#fsViewModal").modal('show'); // 打开模态框

        // 视图模态框 点击 “关闭” 按钮
        $("#closeBtn").on("click", function() {
            $("#fsViewModal").modal('hide'); // 隐藏模态框
        })

        // 视图模态框 点击 “确认” 按钮
        $("#confirmBtn").on("click", function() {
            $("#fsViewModal").modal('hide'); // 隐藏模态框
            if (params.doneFunction) {
                if (fsSwal.verifyIEVersion()) { // 在 IE9及IE9以下 发现 "hidden.bs.modal" 事件有bug
                    return params.doneFunction(true); 
                } else {
                    // 此事件在模态框被隐藏（并且同时在 CSS 过渡效果完成）之后被触发。
                    $('#fsViewModal').on('hidden.bs.modal', function (e) { 
                        return params.doneFunction(true); // 回调函数 -- 传值true，表示点击了“确认”按钮
                    });
                }
            } 
        }); // bootstrap API -- 结束

        // 设置 显示时间 -- 隐藏
        if (params.timer) {
            params.timer = parseInt(params.timer); 
            setTimeout(function() {
                $("#fsViewModal").modal('hide'); // 隐藏模态框
            }, params.timer);
        }

    },
    /*
     * Allow user to pass their own params
     */
    extend: function(a, b) {
        for (var key in b) {
            if (b.hasOwnProperty(key)) {
                a[key] = b[key];
            }
        }
        return a;
    },
    /**
     * {verifyIEVersion 检查IE版本 -- bootstrap模态框 hidden.bs.modal 事件在IE 9有bug} 
     * 
     */
    verifyIEVersion: function() {
        if (navigator.appName == "Microsoft Internet Explorer" && parseInt(navigator.appVersion.split(";")[1].replace(/[ ]/g, "").replace("MSIE", "")) <= 9) {
            return true;
        } else {
            return false;
        }
    },
    /*
     *  {argumentOrDefault 模态框}
     *  @param key 键
     */
    argumentOrDefault: function(opts, key) {
        var args = opts;
        //return (args[key] === undefined) ?  fsSwal.data.defaultParams[key] : args[key];
        if (args[key]) { // 返回用户定义的值
            return args[key];
        } else { // 返回 默认的值
            return fsSwal.data.defaultParams[key];
        }
    },
    /*
     * Add modal + overlay to DOM
     */
    createDom: function(injectedHTML) {
        //var fsSwalWrap = document.createElement('div'); // 产生 div 标签 sweetWrap
        //fsSwalWrap.innerHTML = injectedHTML; // 将预定义 的 dom div 树形结构 插进来
        // Append elements to body  附加 元素到 body 中
        // while (fsSwal.firstChild) {
        //     document.body.appendChild(fsSwal.firstChild);
        // }
        $(document.body).append(injectedHTML); // 使用 jQuery，在 document.body 中注入
    },
    /*
     *  {getNowFormatDate 获取当前时间}
     *
     *  @return currentdate 当前时间
     */
    getNowFormatDate: function() {
        var date = new Date();
        var seperator1 = "-";
        var seperator2 = ":";
        var month = date.getMonth() + 1;
        var strDate = date.getDate();
        if (month >= 1 && month <= 9) {
            month = "0" + month;
        }
        if (strDate >= 0 && strDate <= 9) {
            strDate = "0" + strDate;
        }
        var currentdate = date.getFullYear() + seperator1 + month + seperator1 + strDate
                + " " + date.getHours() + seperator2 + date.getMinutes()
                + seperator2 + date.getSeconds();
        return currentdate;
    }

}


