            text: '请输入内容', // 正文
            type: "notice", // 样式 error、info、warning、notice、success -- 使用FontAwesome图标  class="fa fa-anchor xxx" 控制颜色大小 .xxx{color: #B40C0F; font-size: 50px;}
            errCode: "04010004", // 错误编码  -- 未写
